import React from 'react';
import './Background.css';

const Carousel = () => {
  return (
    <div id="carouselExampleSlidesOnly" className="carousel slide" data-bs-ride="carousel">
      <div className="carousel-inner">
        <div className="carousel-item active">
          <img src="https://m.media-amazon.com/images/I/41vOhvESNcL._SR600%2C315_PIWhiteStrip%2CBottomLeft%2C0%2C35_SCLZZZZZZZ_FMpng_BG255%2C255%2C255.jpg" className="d-block w-100" alt="First Slide" />
        </div>
        <div className="carousel-item">
          <img src="https://via.placeholder.com/800x400?text=Second+Slide" className="d-block w-100" alt="Second Slide" />
        </div>
        <div className="carousel-item">
          <img src="https://via.placeholder.com/800x400?text=Third+Slide" className="d-block w-100" alt="Third Slide" />
        </div>
      </div>
    </div>
  );
};

export default Carousel;
